		function shuffleArray(arr)
		{
			var tempArr=[];
			var n=arr.length;// first
			for (var i = 0; i<n-1; i+=1)
			{
				tempArr.push(arr.splice(Math.floor(Math.random()*arr.length),1)[0]);
			}
			tempArr.push(arr[0]);// Push remaining item onto tempArr 
			return tempArr;
		}
		
