		// answer clicked
		function optClick(e)
		{
			console.log('clicked:',e.currentTarget.isRight, e.currentTarget);
			///console.log(e.currentTarget.answerText.text, questionBox.rightAnswer);
			hideLifelines();
			
			///if(e.currentTarget.answerText.text != questionBox.rightAnswer)
			if( ! e.currentTarget.isRight)
			{
				if(lifelinesLeft==0)
				{
					//popup.youLoseBox.visible = true;
					clearInterval(timerID);//countdownTimer.stop();
					cjs.Tween.get(popup.youLoseBox, { loop: false }).to({y:incorrectYup}, 350, cjs.Ease.backOut);

				} else {	
					//popup.incorrectBox.visible = true;//animate to continue, click a life line
					cjs.Tween.get(popup.incorrectBox, { loop: false }).to({y:incorrectYup}, 350, cjs.Ease.backOut);
					questionBox.highlight.visible = true;// lifelines
					showLifelines();
				}
			}
			///if(e.currentTarget.answerText.text == questionBox.rightAnswer)
			if(e.currentTarget.isRight)
			{
				switch(questionNumber)
				{
					case 4:
						congratsBox.visible = true;// animate fade in
						congratsBox.alpha=0;
						congratsBox.scoreBox.text = "$1,000";
						cjs.Tween.get(congratsBox, { loop: false }).to({alpha:1}, 500, cjs.Ease.backOut);
						
						background.spinningRays.play();
						money.visible = false;
						questionBox.visible = false;
						liner.visible = false;
						for(var i=0; i<optins.length; i+=1) { optins[i].visible = false; }
						timerBox.visible = false;
						questionNumber += 1;
						break;
					case 9:
						congratsBox.alpha=0;
						congratsBox.visible = true;
						congratsBox.scoreBox.text = "$32,000";
						cjs.Tween.get(congratsBox, { loop: false }).to({alpha:1}, 500, cjs.Ease.backOut);
						
						background.spinningRays.play();
						money.visible = false;
						questionBox.visible = false;
						liner.visible = false;
						for(var o=0; o<optins.length; o+=1) { optins[o].visible = false; }
						timerBox.visible = false;
						questionNumber += 1;
						break;
					case 14:
						clearInterval(timerID);//countdownTimer.stop();
						stage.children[0].gotoAndStop(2);//nextFrame();
						break;
						
					default:
						popOutOptions();
						clearInterval(timerID);//countdownTimer.stop();
						timerBox.countdownBox.text = "";
				}
			}
		}
	
